import "./CategoryBadge.css";

import Purify from "../../utils/Purify";
import React from "react";

const CategoryBadge = ({ blog }) => {
  return (
    <span onClick={() => console.log("Category clicked!")}>
      {Purify(blog.category)}
    </span>
  );
};

export default CategoryBadge;
